function generateUUID(){const t=localStorage.getItem("persistentUUID");if(t)return t;const e=navigator.userAgent,o=`${screen.width}x${screen.height}`,n=navigator.language,c=e+o+n,i=Date.now();let r=e+o+n+i;console.log(1),r+=i,console.log(r);var s=CryptoJS.SHA1(r).toString(CryptoJS.enc.Hex);return console.log(s),localStorage.setItem("persistentUUID",s),s}const fingerprintjsFun=async()=>{try{const n=(await(await(await import("https://openfpcdn.io/fingerprintjs/v4")).load()).get()).visitorId;return console.log(n),n}catch(t){return console.error("Error generating visitor ID:",t),null}};document.getElementById("generate-btn").addEventListener("click",async()=>{const t=generateUUID(),e=await fingerprintjsFun();document.getElementById("output").innerHTML=`Fingerprint ID: ${e} <br><br>`,document.getElementById("output").innerHTML+=`UUID: ${t} `,console.log(1,e)});
